去地球.title:
function _(ctx, effect, { DefineFn, GameStateFn }) {
            const runtimeBattleArea = GameStateFn.getRuntimeBattleArea(ctx, "\u6226\u95D8\u30A8\u30EA\u30A21");
            if (runtimeBattleArea == "\u5B87\u5B99\u30A8\u30EA\u30A2")
              return [];
            const playerId = DefineFn.EffectFn.getPlayerID(effect), opponentPlayerId = DefineFn.PlayerIDFn.getOpponent(playerId);
            let unitIds = GameStateFn.getCardLikeItemIdsByBasyou(ctx, DefineFn.AbsoluteBaSyouFn.of(playerId, "\u914D\u5099\u30A8\u30EA\u30A2")).filter((cardId) => GameStateFn.getSetGroupRoot(ctx, cardId)).filter((cardId) => GameStateFn.getCardBattleArea(ctx, cardId).includes(runtimeBattleArea));
            const opponentUnitIds = GameStateFn.getBattleGroup(ctx, DefineFn.AbsoluteBaSyouFn.of(opponentPlayerId, "\u6226\u95D8\u30A8\u30EA\u30A21"));
            if (opponentUnitIds.length) {
              if (GameStateFn.isABattleGroup(ctx, ["\u9AD8\u6A5F\u52D5"], opponentUnitIds[0]))
                unitIds = unitIds.filter((id) => GameStateFn.isABattleGroup(ctx, ["\u9AD8\u6A5F\u52D5"], id));
            }
            const pairs = unitIds.map((id) => {
              return [id, GameStateFn.getItemBaSyou(ctx, id)];
            });
            return [
              {
                title: ["\u30AB\u30FC\u30C9", pairs, pairs]
              }
            ];
          }

