actions.title:
function _(ctx, effect, { DefineFn, GameStateFn }) {
                const playerId = DefineFn.EffectFn.getPlayerID(effect), fackCardId = DefineFn.EffectFn.getCardID(effect), earthPairs = GameStateFn.getCardTipStrBaSyouPairs(ctx, "\u53BB\u5730\u7403", fackCardId);
                for (const pair of earthPairs)
                  ctx = GameStateFn.moveItem(ctx, DefineFn.AbsoluteBaSyouFn.of(playerId, "\u6226\u95D8\u30A8\u30EA\u30A21"), pair, GameStateFn.onMoveItem);
                const spacePairs = GameStateFn.getCardTipStrBaSyouPairs(ctx, "\u53BB\u5B87\u5B99", fackCardId);
                for (const pair of spacePairs)
                  ctx = GameStateFn.moveItem(ctx, DefineFn.AbsoluteBaSyouFn.of(playerId, "\u6226\u95D8\u30A8\u30EA\u30A22"), pair, GameStateFn.onMoveItem);
                ctx = GameStateFn.setNextPhase(ctx);
                return ctx;
              }
